package com.nc.autumn2020.solutions.additional;

import java.io.*;
import java.util.Base64;

public class Additional {
    public void run() {
        String encode = "";

        try(FileOutputStream decodeImg = new FileOutputStream("C://project/myImg.png"))
        {
            byte[] unknwnImg = Base64.getDecoder().decode(encode);
            decodeImg.write(unknwnImg);
        }
        catch (IOException ex){
            System.out.println(ex.getMessage());
        }

        System.out.println("File written");

    }
}
